import React, { Component } from 'react'
import Table from 'react-bootstrap/Table';

class Track extends React.Component
{
    render() {        
        if ( !this.props.data ) {
            return('');
        }

        const trackInfo = this.props.data;

        return (            
            <div>
                <h3>{ trackInfo.name }</h3>        
                <h4>Track times</h4>
                <div>
                <Table responsive>
                    <thead>
                        <tr>
                            <th>AI Level</th>
                            <th>Target time</th>
                        </tr>
                    </thead>
                    <tbody>
                    {                        
                        trackInfo.times == null ? '' : trackInfo.times.map( (time) => 
                            <tr>
                                <td>100</td> 
                                <td>{time}</td> 
                            </tr>
                        )
                    }
                    </tbody>
                </Table>
                </div>
            </div>
        )
    }
}

export default Track;
